import React from 'react'

export default function LogIn() {
  return (
    <div>
        <div className="flex item-center pt-60 bg-[#1d3578]">
            <form action="">
                    <p>SIGN IN</p>
                    <label for="email adress"></label>
            </form>
        </div>
    </div>
  )
}
